using Amazon.CDK;
using Amazon.CDK.AWS.EC2;
using Amazon.CDK.AWS.ElasticLoadBalancingV2;
using Amazon.CDK.AWS.Route53;

Stack stack = new Stack();
Vpc vpc = new Vpc(stack, "VPC");
NetworkLoadBalancer nlb = new NetworkLoadBalancer(stack, "NLB", new NetworkLoadBalancerProps {
    Vpc = vpc
});
VpcEndpointService vpces = new VpcEndpointService(stack, "VPCES", new VpcEndpointServiceProps {
    VpcEndpointServiceLoadBalancers = new [] { nlb }
});
// You must use a public hosted zone so domain ownership can be verified
PublicHostedZone zone = new PublicHostedZone(stack, "PHZ", new PublicHostedZoneProps {
    ZoneName = "aws-cdk.dev"
});
new VpcEndpointServiceDomainName(stack, "EndpointDomain", new VpcEndpointServiceDomainNameProps {
    EndpointService = vpces,
    DomainName = "my-stuff.aws-cdk.dev",
    PublicHostedZone = zone
});

